import React from 'react';
import Footer from "./component/Footer/Footer";
import HeaderMain from "./component/HeaderMain/HeaderMain";
import './Public.scss';

function Public(props) {
  return (
    <div>
      <HeaderMain />
      <Footer />
    </div>
  );
}

export default Public;
